func sendEther(client *ethclient.Client, fromEO ExtAcc, toAddr common.Address, value *big.Int, hugegasPrice bool, nonce uint64) (common.Hash, error) {
	gasLimit := uint64(3e4)
	var gasPrice *big.Int
	if hugegasPrice {
		gasPrice = big.NewInt(params.Ether / 10000)
	} else {
		gasPrice = big.NewInt(params.GWei * 100)
	}

	tx := types.NewTransaction(nonce, toAddr, value, gasLimit, gasPrice, nil)
	chainId := big.NewInt(714)
	signedTx, err := types.SignTx(tx, types.NewEIP155Signer(chainId), fromEO.key)
	if err != nil {
		return common.Hash{}, err
	}
	err = client.SendTransaction(context.Background(), signedTx)
	if err != nil {
		return common.Hash{}, err
	}
	txhash := signedTx.Hash()
	//log.Printf("tx hash, sendEther: %s\n", txhash.Hex())
	return txhash, nil
}

func createContract(client *ethclient.Client, fromEO ExtAcc, value *big.Int, hugegasPrice bool, nonce uint64) (common.Hash, error) {
	gasLimit := uint64(3e7)
	var gasPrice *big.Int
	if hugegasPrice {
		gasPrice = big.NewInt(params.Ether / 10000)
	} else {
		gasPrice = big.NewInt(params.GWei * 20)
	}

	bytes, _ := hex.DecodeString("%")
	tx := types.NewContractCreation(nonce, value, gasLimit, gasPrice, bytes)
	chainId := big.NewInt(97)
	signedTx, err := types.SignTx(tx, types.NewEIP155Signer(chainId), fromEO.key)
	if err != nil {
		return common.Hash{}, err
	}
	err = client.SendTransaction(context.Background(), signedTx)
	if err != nil {
		return common.Hash{}, err
	}
	txhash := signedTx.Hash()
	//log.Printf("tx hash, sendEther: %s\n", txhash.Hex())
	return txhash, nil
}

type ExtAcc struct {
	key  *ecdsa.PrivateKey
	addr common.Address
}

func fromHexKey(hexkey string) (ExtAcc, error) {
	key, err := crypto.HexToECDSA(hexkey)
	if err != nil {
		return ExtAcc{}, err
	}
	pubKey := key.Public()
	pubKeyECDSA, ok := pubKey.(*ecdsa.PublicKey)
	if !ok {
		err = errors.New("publicKey is not of type *ecdsa.PublicKey")
		return ExtAcc{}, err
	}
	addr := crypto.PubkeyToAddress(*pubKeyECDSA)
	return ExtAcc{key, addr}, nil
}

type TransferInUnboundTokenEvent struct {
	Sequence        *big.Int
	RefundAddr      common.Address
	Recipient       common.Address
	Amount          *big.Int
	ContractAddr    common.Address
	Bep2TokenSymbol common.Hash
}

func recoverSigner(header *types.Header) (common.Address, error) {
	signature := header.Extra[len(header.Extra)-65:]

	// Recover the public key and the Ethereum address
	pubkey, err := crypto.Ecrecover(SealHash(header).Bytes(), signature)
	if err != nil {
		return common.Address{}, err
	}
	var signer common.Address
	copy(signer[:], crypto.Keccak256(pubkey[1:])[12:])
	return signer, nil
}

// SealHash returns the hash of a block prior to it being sealed.
func SealHash(header *types.Header) (hash common.Hash) {
	hasher := sha3.NewLegacyKeccak256()
	encodeSigHeader(hasher, header)
	hasher.Sum(hash[:0])
	return hash
}

func encodeSigHeader(w io.Writer, header *types.Header) {
	err := rlp.Encode(w, []interface{}{
		header.ParentHash,
		header.UncleHash,
		header.Coinbase,
		header.Root,
		header.TxHash,
		header.ReceiptHash,
		header.Bloom,
		header.Difficulty,
		header.Number,
		header.GasLimit,
		header.GasUsed,
		header.Time,
		header.Extra[:len(header.Extra)-crypto.SignatureLength], // Yes, this will panic if extra is too short
		header.MixDigest,
		header.Nonce,
	})
	if err != nil {
		panic("can't encode: " + err.Error())
	}
}

func TestEstiMate(t *testing.T) {
	client, err := ethclient.Dial(endpoint)
	assert.NoError(t, err)

	nonce, err := client.PendingNonceAt(context.Background(), account.addr)

	gasPrice, err := client.SuggestGasPrice(context.Background())
	assert.NoError(t, err)
	auth := bind.NewKeyedTransactor(account.key)
	auth.Nonce = big.NewInt(int64(nonce))
	auth.Value = big.NewInt(1000)
	auth.GasPrice = gasPrice

	msg := ethereum.CallMsg{
		auth.From,
		&validatorSetAddr,
		0,
		auth.GasPrice,
		auth.Value,
		nil,
	}

	res, err := client.EstimateGas(context.Background(), msg)
	assert.NoError(t, err)
	fmt.Println(string(res))
}

